import React from 'react';

const GroceryList = () => {
    return (
        <div className='groceryForm'>
            <form>
                <label for='groceries'>Groceries</label><br></br>
                <input type='text' id='groceryInput' placeholder='Peanut Butter'></input>
            </form>

            <ul className=''>
                <li>Peanut Butter</li>
            </ul>
        </div>
    );
}

export default GroceryList;
